import 'react-canvas-paint/dist/index.css'
import CanvasDraw from "react-canvas-draw";

export default function DrawCanvas() {
    const styles = {
        border: {
            marginLeft: '200px',
            marginTop: '200px'
        }
    }
    return (
        <div>
            <h1>Image Drawing Canvas</h1>
            <div style={styles.border}>
            <CanvasDraw />
            </div>
        </div>
    );
};
